const usersReducer = function() {
    return [
        {
            id: 1,
            first_name: "Santee",
            last_name: "Cooper",
            age: 33,
            description: "Santee is a genius programmer ever"
        },
        {
            id: 2,
            first_name: "Kathy",
            last_name: "Shannon",
            age: 28,
            description: "Kathy loves Santee and is his mistress"
        },
        {
            id: 3,
            first_name: "Abigail",
            last_name: "Fox",
            age: 23,
            description: "Abigail loves Santee and is his mistress"
        }
    ]
}

export default usersReducer;
